jQuery(document).ready(function(){
    //check whether what and where autocomplete is enabled on the page
    var what_enable  = jQuery('#what_enable').val();
    var where_enable = jQuery('#where_enable').val();
    var form_name	= jQuery('#get_quotes_submit').closest('form').attr('name');

    var keyword_placeholder  = jQuery('#keyword').data('placeholder');
    var where_placeholder    = jQuery('#where').data('placeholder');
    var jobdesc_placeholder = jQuery('#jobdesc').data('placeholder');

    if(what_enable=='1'){if(jQuery('#keyword').val()=='') jQuery('#keyword').val(keyword_placeholder).css({'color':'#aaa'});}
    if(where_enable=='1'){if(jQuery('#where').val()=='')   jQuery('#where').val(where_placeholder).css({'color':'#aaa'});}
    if(jQuery('#jobdesc').val()=='') jQuery('#jobdesc').val(jobdesc_placeholder).css({'color':'#aaa'});

    if(what_enable=='1')
    {
        jQuery('#keyword').keyup(function() {
            jQuery(this).css({'color':'#333'});
            getCategoryQuestionsByAJAX(this.value,'autocomplete',null);
        });
    }
    if(where_enable=='1'){
        jQuery('#where').keyup(function() {
            jQuery(this).css({'color':'#333'});
        });
    }

    setTimeout("jQuery('#keyword').focus()",400);

    if(what_enable=='1')
    {
        if (jQuery("#keyword").is(":focus")) {
            if(jQuery("#keyword").val() == keyword_placeholder) jQuery("#keyword").val('').css({'color':'#333'});
        }
        jQuery('#keyword').focus(function(){
            if(jQuery(this).val() == keyword_placeholder) jQuery(this).val('').css({'color':'#333'});
        });

        jQuery('#keyword').focusout(function(){
            if(jQuery(this).val() == '') jQuery(this).val(keyword_placeholder).css({'color':'#aaa'});
        });

    }

    if(where_enable=='1'){

        jQuery('#where').focus(function(){
            if(jQuery(this).val()==where_placeholder) jQuery(this).val('').css({'color':'#333'});
        });
        jQuery('#where').focusout(function(){
            if(jQuery(this).val() == '') jQuery(this).val(where_placeholder).css({'color':'#aaa'});
            else jQuery(this).css({'color':'#333'});
        });
    }
    jQuery('#jobdesc').focus(function(){
        if(jQuery(this).val() == jobdesc_placeholder) {
            jQuery(this).val('').css({'color':'#333'});
        }
    });
    jQuery('#jobdesc').blur(function(){
        if(jQuery(this).val() == '') {
            jQuery(this).val(jobdesc_placeholder);
            jQuery(this).css({'color':'#aaa'});
        } else {
            jQuery(this).css({'color':'#333'});
        }
    });


    jQuery('form[name='+form_name+']').submit(function(){

        if (form_name === 'post_job_form_autocomplete') {
            // announce that the form is submitting
            $(document).trigger('submit.get_quotes_form');
        }

        if(jQuery('#keyword').val() == keyword_placeholder) jQuery('#keyword').val('');
        if(jQuery('#where').val() == where_placeholder) jQuery('#where').val('');
        if(jQuery('#jobdesc').val() == jobdesc_placeholder) jQuery('#jobdesc').val('');
    });

    if(what_enable=='1')
    {
        var what_autocomplete = new VTKAutoComplete();
        var default_txt = jQuery('#keyword').val();
        var default_keywords_help = '';

        what_autocomplete.init({
            "queryFieldId": 'keyword',
            "queryFieldHelpInfo": default_keywords_help,
            "initValue": default_txt,
            "lookupURLPrefix": "/system/ajax_handlers/vtk.ac.search.category.server.php?query=",
            "formName":form_name,
            "formAutoSubmit": false,
            "FixedWidth": 302,
            "Alignment": "left",
            "otherFieldName": "search_what",
            "hiddenDivId": "hip_keywords_suggests_ac"
        });

        what_autocomplete.vtc_ac_keyenter_handler = function ()
        {
            return false;
        }

        what_autocomplete.vtc_ac_after_select_handler = function (value, text)
        {
            getCategoryQuestionsByAJAX(text,'autocomplete','');
            setTimeout(function() {
                if(jQuery("[id*=get_quotes_question_]").length > 0)
                {
                    jQuery("[id*=get_quotes_question_]").first().focus()
                }
                else
                {
                    jQuery('#where').focus();
                }
            },500);
        }

        what_autocomplete.vtc_ac_keytab_handler = function (value, text)
        {
            getCategoryQuestionsByAJAX(text,'autocomplete','');
            setTimeout(function() {
                if(jQuery("[id*=get_quotes_question_]").length > 0)
                {
                    jQuery("[id*=get_quotes_question_]").first().focus()
                }
                else
                {
                    jQuery('#where').focus();
                }
            },500);
        }
    }
    if(where_enable=='1')
    {
        var where_autocomplete = new VTKAutoComplete();
        var default_zip_value = jQuery('#where').val();
        var default_zip_help = '';

        where_autocomplete.init({
            "queryFieldId": 'where',
            "queryFieldHelpInfo": default_zip_help,
            "showQueryFieldHelpInfoOnFocus": true,
            "initValue": default_zip_value,
            "lookupURLPrefix": "/system/ajax_handlers/vtk.ac.search.zip.server.php?query=",
            "formName":form_name,
            "formAutoSubmit": false,
            "FixedWidth": 240,
            "Alignment": "left",
            "PositionAdjust": true,
            "otherFieldName": "search_where",
            "hiddenDivId": "hip_search_zip_suggests_ac"
        });
        where_autocomplete.vtc_ac_after_select_handler = function (value, text){
            setTimeout(function() {
                jQuery('#where').closest('li').next().find('.input_field').first().focus();
            },500);

            $('#' + this.queryFieldId).val(value).trigger('change');
        }

        where_autocomplete.vtc_ac_keyenter_handler = function ()
        {
            return false;
        }
        where_autocomplete.vtc_ac_keytab_handler = function (value, text)
        {
            setTimeout(function() {
                jQuery('#where').closest('li').next().find('.input_field').first().focus();
            },500);
        }
    }

    jQuery("#why_need_email").click(function(){
        showWhyNeedInfoPopup("why_need_email","why_need_email_popup","why_need_email_msg","form_wrapper");
    });

    jQuery("#why_need_phone").click(function(){
        showWhyNeedInfoPopup("why_need_phone","why_need_phone_popup","why_need_phone_msg","form_wrapper");
    });
});

