function repositionWhereautocomplete()
{
    setTimeout(function(){
        var where_field_offset = jQuery('#where').offset();
        jQuery('#hip_search_zip_suggests_ac').css('top', where_field_offset.top + jQuery('#where').outerHeight());
        jQuery('#hip_search_zip_suggests_ac').css('left', where_field_offset.left);
    }, 1000);
}

function repositionWhatautocomplete()
{

    setTimeout(function(){
        var what_field_offset = jQuery('#keyword').offset();
        jQuery('#hip_keywords_suggests_ac').css('top', what_field_offset.top + jQuery('#keyword').outerHeight());
        jQuery('#hip_keywords_suggests_ac').css('left', what_field_offset.left);
    }, 1000);
}

function showWhyNeedInfoPopup(element_id, popup_id, message_content_id, wrapper)
{
    if(VTK_Mobile.isMobile()) {
        /* once off actions */
        jQuery("#"+message_content_id).appendTo(jQuery("#"+element_id).parent());
        jQuery("#"+message_content_id+' div:first-child').addClass('clear_left').removeClass('pal');
        jQuery("#"+message_content_id+' h3.primary').remove();
        if(jQuery("#"+message_content_id).is(":visible")){
            jQuery("#"+message_content_id).addClass('hidden');
        } else {
            jQuery("#"+message_content_id).removeClass('hidden');
        }
    } else {
        var msg = document.getElementById(message_content_id).innerHTML;
        jQuery("#"+popup_id).remove();
        var popup = new clsLightPopup();
        popup.publicFunctions.construct(popup, {
            pageElements:{
                container:"#"+wrapper,
                position:"#"+element_id
            },
            height:"auto",
            width:"400px",
            offsetLeft:-40,
            offsetTop:-20,
            identifier:popup_id,
            alternative_style_class:" shadow bordered",
            close_image:"transparent url(/style/default/images/fancy_box/fancy_closebox.png) repeat scroll 0 0",
            raw_content: msg
        });

        popup.publicFunctions.loadData(popup, function(data) {
            popup.publicFunctions.show(popup);
        });
    }
}
VTK_Custom_Control = {
    'init': function() {
        jQuery(document).ready(function(){
            jQuery('input[name^="get_quotes_question_"]:checked').each(function(){
                jQuery(this).addClass('checked');
                if(jQuery(this).parent().hasClass('custom_control_radio')){
                    jQuery(this).parent().addClass('custom_control_radio_selected').removeClass('custom_control_radio');
                } else {
                    jQuery(this).parent().addClass('custom_control_checkbox_selected').removeClass('custom_control_checkbox');
                }
            });

            jQuery('.js_row').each(function(){
                var checkbox_wrappers = jQuery(this).find('.js_toggle_checkbox_wrapper');
                var wrapper_height = 0;
                checkbox_wrappers.each(function(){
                    if(wrapper_height < jQuery(this).height()) {
                        wrapper_height = jQuery(this).height();
                    }
                });
                if(wrapper_height > checkbox_wrappers.height()){
                    jQuery(this).find('.js_toggle_checkbox_wrapper').height(wrapper_height);
                }
            });
        });
        VTK_Custom_Control.initCustomCheckboxes();
        VTK_Custom_Control.initCustomRadios();
    },
    'initCustomCheckboxes': function() {
        jQuery(document).ready(function(){
            if(jQuery('.js_toggle_checkbox_wrapper').length > 0) {
                jQuery('.js_toggle_checkbox_wrapper').on('click',function(){
                    VTK_Custom_Control.initCustomCheckboxesToggle(jQuery(this));

                });
            }
        });
    },
    'initCustomRadios': function() {
        jQuery(document).ready(function(){
            if(jQuery('.js_toggle_radio_wrapper').length > 0) {
                jQuery('.js_toggle_radio_wrapper').on('click',function(){
                    VTK_Custom_Control.initCustomRadiosToggle(jQuery(this));

                });
            }
        });
    },
    'initCustomCheckboxesToggle': function(_element) {

        var current_wrapper = _element;
        if(current_wrapper.find('input[type=checkbox]').hasClass('checked')){
            current_wrapper.find('input[type=checkbox]').removeAttr('checked').removeClass('checked');
            current_wrapper.addClass('custom_control_checkbox').removeClass('custom_control_checkbox_selected');
        } else {
            current_wrapper.find('input[type=checkbox]').attr('checked', 'checked').addClass('checked');
            current_wrapper.addClass('custom_control_checkbox_selected').removeClass('custom_control_checkbox');
        }
        getGAEventTrackingCode('Post Job','Post Job - Click Get Quotes Custom Control Checkbox','Post Job - Click Get Quotes Custom Control Checkbox');

    },
    'initCustomRadiosToggle': function(_element) {

        var current_wrapper = _element;
        var parent_wrapper = current_wrapper.closest('.js_radio_wrapper');
        parent_wrapper.find('input[type=radio]').removeAttr('checked');
        parent_wrapper.find('.js_toggle_radio_wrapper').addClass('custom_control_radio').removeClass('custom_control_radio_selected');
        current_wrapper.find('input[type=radio]').attr('checked', 'checked');
        current_wrapper.addClass('custom_control_radio_selected').removeClass('custom_control_radio');
        getGAEventTrackingCode('Post Job','Post Job - Click Get Quotes Custom Control Radio','Post Job - Click Get Quotes Custom Control Radio');

    },
    'initCustomCheckboxesWithinWrapper': function(_element) {

        if(_element.find('.js_toggle_checkbox_wrapper').length > 0) {
            _element.find('.js_toggle_checkbox_wrapper').on('click',function(){
                VTK_Custom_Control.initCustomCheckboxesToggle(jQuery(this));

            });
        }

    },
    'initCustomRadiosWithinWrapper': function(_element) {

        if(_element.find('.js_toggle_radio_wrapper').length > 0) {
            _element.find('.js_toggle_radio_wrapper').on('click',function(){
                VTK_Custom_Control.initCustomRadiosToggle(jQuery(this));

            });
        }
    }
}

